DELIMITER $$
CREATE TRIGGER `SetDateNaissanceBasedOnNumSecu` BEFORE INSERT ON `patient` FOR EACH ROW BEGIN
    DECLARE num_secu_year CHAR(2);
    DECLARE num_secu_month CHAR(2);
    
    -- Extract the year and month from positions 3 to 6 of Num_secu
    SET num_secu_year = SUBSTRING(NEW.Num_secu, 3, 2);
    SET num_secu_month = SUBSTRING(NEW.Num_secu, 5, 2);
    
    -- Convert the extracted year and month into a complete date and set Date_naissance
    SET NEW.Date_naissance = STR_TO_DATE(CONCAT('20', num_secu_year, num_secu_month, '01'), '%Y%m%d');
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `SetSexeBasedOnNumSecu` BEFORE INSERT ON `patient` FOR EACH ROW BEGIN
    DECLARE num_secu_prefix CHAR(2);
    SET num_secu_prefix = LEFT(NEW.Num_secu, 2);
    
    IF num_secu_prefix = '01' or '07' THEN
        SET NEW.Sexe = 'Homme';
    ELSEIF num_secu_prefix = '02' or '08' THEN
        SET NEW.Sexe = 'Femme';
    END IF;
END
$$
DELIMITER ;

